        d="M20 19v.5a.5.5 0 00.5-.5H20zm0-.5h-6.875v1H20v-1zm.5.5v-6.875h-1V19h1zm-.146-.353l-15-15-.708.707 15 15 .708-.707z"
        fill="currentColor"
      />
    </svg>
  );
}

export default SvgBottomRight;
